To find the area of the triangle \(OAB\), we need to calculate the magnitude of the cross product of the vectors \(\overrightarrow{OA}\) and \(\overrightarrow{OB}\) and then divide it by 2. The area of the triangle is given by:

\[
\text{Area} = \frac{1}{2} \|\overrightarrow{OA} \times \overrightarrow{OB}\|
\]

First, let's find the cross product \(\overrightarrow{OA} \times \overrightarrow{OB}\).

The cross product of two vectors \(\overrightarrow{u} = \begin{pmatrix} u_1 \\ u_2 \\ u_3 \end{pmatrix}\) and \(\overrightarrow{v} = \begin{pmatrix} v_1 \\ v_2 \\ v_3 \end{pmatrix}\) is given by:

\[
\overrightarrow{u} \times \overrightarrow{v} = \begin{vmatrix}
\mathbf{i} & \mathbf{j} & \mathbf{k} \\
u_1 & u_2 & u_3 \\
v_1 & v_2 & v_3
 \end{vmatrix}
= \begin{pmatrix}
u_2 v_3 - u_3 v_2 \\
u_3 v_1 - u_1 v_3 \\
u_1 v_2 - u_2 v_1
\end{pmatrix}
\]

For \(\overrightarrow{OA} = \begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix}\) and \(\overrightarrow{OB} = \begin{pmatrix} -3 \\ -2 \\ 1 \end{pmatrix}\), we have:

\[
\overrightarrow{OA} \times \overrightarrow{OB} = \begin{vmatrix}
\mathbf{i} & \mathbf{j} & \mathbf{k} \\
1 & 2 & 3 \\
-3 & -2 & 1
\end{vmatrix}
= \begin{pmatrix}
2 \cdot 1 - 3 \cdot (-2) \\
3 \cdot (-3) - 1 \cdot 1 \\
1 \cdot (-2) - 2 \cdot (-3)
\end{pmatrix}
= \begin{pmatrix}
2 + 6  \\
-9 - 1 \\
-2 + 6
\end{pmatrix}
= \begin{pmatrix}
8 \\
-10 \\
4
\end{pmatrix}
\]

Next, we calculate the magnitude of the resulting vector \(\overrightarrow{OA} \times \overrightarrow{OB}\):

\[
\|\overrightarrow{OA} \times \overrightarrow{OB}\| = \sqrt{8^2 + (-10)^2 + 4^2}
= \sqrt{64 + 100 + 16}
= \sqrt{180}
= 6\sqrt{5}
\]

Finally, the area of the triangle \(OAB\) is:

\[
\text{Area} = \frac{1}{2} \|\overrightarrow{OA} \times \overrightarrow{OB}\| = \frac{1}{2} \cdot 6\sqrt{5} = 3\sqrt{5}
\]

Therefore, the area of the triangle \(OAB\) is \(\boxed{3\sqrt{5}}\).\\
